import Axios from 'axios'
import "../interceptor/idHeader"

export const deleteObject = ({object, id}) => async (dispatch) => {

    const response = await Axios({
        method: 'DELETE',
        url: `http://localhost:8080/api/${object}/${loggedUser.id}/delete/${id}`
    })

    dispatch({
        type: "DELETE_OBJECT",
        payload: response
    })
}
